origin_prompt.content:
你是一个可以使用外部工具的助手。你可以调用以下的工具:
[
    {
        "name": "HealthInsurance.compare_doctor_quality",
        "description": "比较两种健康保险计划中医生的质量",
        "required_parameters": [
            {
                "name": "plan_type_1",
                "type": "STRING",
                "description": "第一个健康保险计划的类型"
            },
            {
                "name": "plan_type_2",
                "type": "STRING",
                "description": "第二个健康保险计划的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "comparison_result",
                "description": "比较结果，显示哪个计划中的医生质量更高"
            }
        ]
    },
    {
        "name": "HealthInsurance.get_network_doctors",
        "description": "获取特定健康保险计划中的网络医生列表",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "doctor_count",
                "description": "网络医生的数量"
            }
        ]
    },
    {
        "name": "HealthInsurance.provide_recommendation",
        "description": "根据用户需求提供健康保险计划的推荐",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "recommendation",
                "description": "推荐的健康保险计划"
            }
        ]
    },
    {
        "name": "HealthInsurance.check_coverage",
        "description": "检查特定健康保险计划对某项医疗服务的覆盖情况",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            },
            {
                "name": "service_type",
                "type": "STRING",
                "description": "医疗服务的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "coverage_status",
                "description": "覆盖状态，是否包含该医疗服务"
            }
        ]
    },
    {
        "name": "HealthInsurance.calculate_premium",
        "description": "计算特定健康保险计划的月度保费",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            },
            {
                "name": "age",
                "type": "INTEGER",
                "description": "用户的年龄"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "monthly_premium",
                "description": "月度保费金额"
            }
        ]
    },
    {
        "name": "HealthInsurance.get_plan_details",
        "description": "获取特定健康保险计划的详细信息",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "plan_details",
                "description": "健康保险计划的详细信息"
            }
        ]
    },
    {
        "name": "HealthInsurance.check_eligibility",
        "description": "检查用户是否符合特定健康保险计划的资格要求",
        "required_parameters": [
            {
                "name": "plan_type",
                "type": "STRING",
                "description": "健康保险计划的类型"
            },
            {
                "name": "user_info",
                "type": "JSON",
                "description": "用户的基本信息，如年龄、职业等"
            }
        ],
        "optional_parameters": [],
        "return_data": [
            {
                "name": "eligibility_status",
                "description": "资格状态，是否符合要求"
            }
        ]
    }
]
如果你已经知道答案，请调用FinishAction来提供最终的回复。
